window.onload = function () {}
function navigate() {window.location='./dashboard.html'}
function mainsearchjobs() {var appBanners = document.getElementsByClassName('cssjob'), i;var tds = document.getElementsByClassName('cssjobname');for (var i = 0; i < appBanners.length; i ++) {appBanners[i].style.display = 'none';}document.getElementById('mainsearch').onkeypress = function(e){if (!e) e = window.event;if (e.keyCode == '13') {var tds = document.getElementsByClassName('cssjobname');var appBanners = document.getElementsByClassName('cssjob'), i;for (var j = 0; j < tds.length; j ++) {var se = tds[j].innerHTML;if (se.indexOf(this.value) > -1) {appBanners[j].style.display = 'table-row';}if (se.indexOf(this.value) == '') {appBanners[j].style.display = 'table-row';}}return false;}}}
function mainviewurl() {var x = document.getElementById('selectview').value;if (x == 'Alllocalhost8080') {window.location='http://localhost:8080/view/All/';}if (x == 'CIlocalhost8080') {window.location='http://localhost:8080/';}if (x == 'HTMLlocalhost8080') {window.location='http://localhost:8080/view/HTML/';}if (x == 'Monitorlocalhost8080') {window.location='http://localhost:8080/view/Monitor/';}if (x == 'Sectionedlocalhost8080') {window.location='http://localhost:8080/view/Sectioned/';}}
function localhost8080viewurl(){var x = document.getElementById('localhost8080selectview').value;if (x == 'All') {window.location='http://localhost:8080/view/All/';}if (x == 'CI') {window.location='http://localhost:8080/';}if (x == 'HTML') {window.location='http://localhost:8080/view/HTML/';}if (x == 'Monitor') {window.location='http://localhost:8080/view/Monitor/';}if (x == 'Sectioned') {window.location='http://localhost:8080/view/Sectioned/';}}
function localhost8080searchjobs() {document.getElementById('localhost8080search').onkeypress = function(e){if (!e) e = window.event;if (e.keyCode == '13'){window.location='http://localhost:8080//job/'+this.value;return false;}}}
function contentcollapselocalhost8080(){var x = document.getElementById('testidlocalhost8080').innerHTML;if (x == '[ - ]') {document.getElementById('contentlocalhost8080').style.display = 'none';document.getElementById('testidlocalhost8080').innerHTML = '[ + ]';}else {document.getElementById('contentlocalhost8080').style.display = 'block';document.getElementById('testidlocalhost8080').innerHTML = '[ - ]';}}